import { div } from 'prelude-ls';
import { useState } from 'react'

const Home = () => {

    const [blogs, setBlogs] = useState([
        {title: 'My new website', body: 'lorem ipsum...', authour: 'mario', id: 1 },
        {title: 'Welcome paty!', body: 'lorem ipsum...', authour: 'yoshi', id: 2 },
        {title: 'Web dev top tips', body: 'lorem ipsum...', authour: 'pablo', id: 3 },
    ]);




    return (
        <div className="home">           
            {blogs.map((blog_object) => {
                <div className="blog-preview" key={blog_object.id}> 
                    <h2>{blog_object.title}</h2>
                    <p>{blog_object.title}</p>
                </div>
            })}
        </div>
    )
}

export default Home
